
public class Output51 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		final int i=1;
		switch(i) {
		case i:
		{
			System.out.println("case 1 executed");
			break;
		}
		case i+1:
		{
			System.out.println("case 2 executed");
			break;
		}
		default:
		{
			System.out.println("cases not executed");
		}
		
		}

	}

}
